def extract_params(self, command, paramstring):

    if command in 'Hf':

        params = tuple(int(p) if len(p) != 0 else 1 for p in paramstring.split(';'))

        while len(params) < 2:

            # defaults:

            params = params + (1,)

    else:

        params = tuple(int(p) for p in paramstring.split(';') if len(p) != 0)

        if len(params) == 0:

            # defaults:

            if command in 'JKm':

                params = (0,)

            elif command in 'ABCD':

                params = (1,)



    return params
